INSERT INTO `Scenery` VALUES ('182236', '3338', '山西省太原市迎泽大街长途汽车站东侧大厅（山西省旅游集散中心大厅）', '307', '预订门票统一售票，暂无其他优惠人群政策（各景区优惠人群门票，以景区公告为准）。', '2015-08-2400:05:39.382', '山西各景点直通车。', '迎泽区', '①太原至昌源河湿地公园：每周六06:30发车②太原至常家庄园：每天08:30发车③太原至红崖峡谷：每周二、四、六06:30发车④太原至乔家大院至平遥古城：每天06:30发车⑤太原至石膏山：每周二、四、六、日：06:30发车', '山西省旅游集散中心景区直通车', '太原', '游览中国最大的家族祠堂,欣赏北派最大的私家园林---【静园】,了解常家保存最古老的宅院---【贵和堂】,解读晋商发展史---【养和堂】。品味历代书法家作品---【石芸轩书院】。常家庄园常家庄园红崖大峡谷风景区总面积28平方公里，谷深20余公里，开发利用面积为2072.4公顷。景区内峡谷风光、天然森林、泉水瀑布、高山草甸等原生态景观，令人心旷神怡。峰峦迭起、逶迤绵亘、山崖陡峭、气势雄伟、游人置身于回归自然、返璞归真的人间仙境。红崖大峡谷红崖大峡谷祁县昌源河国家湿地公园，是山西省第三个国家湿地公园。位于祁县县城东部，北起贾令镇贾令桥南至来远镇东鱼沟口，河道总长33公里，总面积1.34万亩，其中湿地面积0.69万亩，占公园总面积的51.30%。晋商古街晋商古街参观有龟城&mdash;&mdash;【平遥古城】，游欣赏古城风貌，领略晋商文化，参观中国行业的鼻祖&mdash;&mdash;【日升昌票号】，中国的华尔街&mdash;&mdash;【明清一条街】；古代官府审案的地方&mdash;&mdash;【古县衙】；保存最整的古城墙。平遥古城平遥古城石膏山，雄踞于太岳山北段，是太岳山主峰之一，海拔2532米，位于灵石县城东南约35公里，北距太原185公里。与介休绵山、沁源灵空山鼎足而立，是省级风景名胜区。风景区总面积约60平方公里，森林覆盖率达95%以上，以山势雄伟、洞奇石怪、古树参天、瀑布飞泉、风景绮丽为特征，自然景观、人文景观和动植物资源十分丰富。石膏山石膏山', 'null', '①门票当天有效，出园需入园，请再次购票。②为保证取票、入园顺利，预订时请务必填写真实姓名、手机号码等信息。', '山西', '23', '{\"lon\":\"112.58492986\",\"lat\":\"37.86616914\"}', '[]');
INSERT INTO `Scenery` VALUES ('32541', '3338', '山西省太原市五一路文庙巷40号', '307', 'A.免票政策：特殊人群预订标准：6周岁以下或1.2米以下的儿童免费；残疾人、现役军人、革命伤残军人持相关证件免费；70周岁以上老人持老年证或身份证免费；大中小学学士集体参观出示学校介绍信免费；持有离休证的老年人免费；持有本地低保证的群众免费；持有光荣军（烈士）属证的群众免费；记者、导游带团持相关证件免费；旅行社踩线人员出示旅游社及导游证或者经理资格证免费；山西省民俗博物馆之友以及山西省民俗博物馆志愿者持相关证件免费。B.优惠政策：儿童身高1.2米&mdash;1.5米之间购景区优惠票；60周岁&mdash;70周岁的老年人持老年证或身份证购景区优惠票（上述优惠政策，需到景区自行购买）。', '2015-08-2400:05:40.842', '山西省最大的民俗文物收藏、保护和文化交流中心', '迎泽区', '09:00--17:00', '山西省民俗博物馆（文庙）', '太原', 'null', 'null', '①预订门票仅为景区参观票。②另付费项目：观看临时展览馆需另付费。活动提醒1.★太原特惠热门景点推荐★宇文山庄票面价450同程价128查看详情&gt;&gt;中国煤炭博物馆票面价60同程价52查看详情&gt;&gt;爱儿玛儿童主题乐园（山西店）票面价80同程价65查看详情&gt;&gt;', '山西', '23', '{\"lon\":\"112.58698120\",\"lat\":\"37.87115753\"}', '[]');
INSERT INTO `Scenery` VALUES ('22458', '3338', '', '307', 'null', '2015-08-2400:05:42.233', '山西省展览馆始建于1958年，是宣传服务于山西经济、政治、文化建设的最大展览基地和重要窗口。自1992年12月经省政府同意、省经贸委批准该馆规划建设山西国际博览中心以来，他们以改革为动力，展览为主业，开发为重点，积极开展全方位、多层次、宽领域的招商招展，先后多次成功承办了全国和全省性博览会、展销会、交易会等大型展览，为推进山西改革开放、发展山西经济做出了积极贡献.', '迎泽区', 'null', '山西省科技馆', '太原', 'null', 'null', 'null', '山西', '23', '{\"lon\":\"112.54275910\",\"lat\":\"37.81018419\"}', '[]');
INSERT INTO `Scenery` VALUES ('22459', '3338', '晋祠路19号', '307', 'null', '2015-08-2400:05:43.722', '山西省展览馆展览中心拥有一座功能比较齐全、设施比较完善、占地面积5万平方米、建筑面积2.6万平方米的新型展览场馆，成为宣传服务于山西经济、政治、文化建设的最大展览基地和重要窗口。', '迎泽区', 'null', '山西省展览馆', '太原', 'null', 'null', 'null', '山西', '23', '{\"lon\":\"112.53665674\",\"lat\":\"37.83669187\"}', '[]');
INSERT INTO `Scenery` VALUES ('3826', '0', '山西太原市文庙巷3号邮编:030001电话:0351—2029436', '0', 'null', '2015-08-2417:49:24.334', '山西省博物馆位于太原市上官巷东，原是文庙。博物馆占地1.3万平方米，由照壁、六角井亭、棂星门、大成门、大成殿、东西庑和崇圣祠组成。棂星门内东西厢房、大成殿及东西庑均为陈列室。馆内藏品丰富，省内出土的古珍贵文物甚多，有殷代铜觥、春秋时吴王称王前所用的铜戈、北魏木板漆画、东晋名画家顾恺之笔法、明代名将戚继光手书《致李小山归蓬莱》诗轴等。', 'null', 'null', '山西省博物馆', 'null', 'null', 'null', 'null', '山西', '23', '{\"lon\":\"112.58587070\",\"lat\":\"37.87082055\"}', '[]');
INSERT INTO `Scenery` VALUES ('29668', '3337', '太原市体育路与王村南街交叉口的西南角，山西省体育场', '307', 'null', '2016-02-1518:38:51.149', '山西省全民健身嬉水活动致力于在夏日打造', '小店区', 'null', '山西省全民健身嬉水活动', '太原', 'null', 'null', 'null', '山西', '23', '{\"lon\":\"0.00000000\",\"lat\":\"0.00000000\"}', '[]');
INSERT INTO `Scenery` VALUES ('229153', '3339', '山西省太原市尖草坪区滨河东路恒大御景湾服务保障：如实描述入园保障周边景点推荐', '307', '免票政策：儿童身高1米（不含）以下免票。', '2018-05-0512:56:54.167', 'null', '尖草坪区', '9:00-19:00', '恒大御景湾勇闯水世界', '太原', '', 'null', '①为保证取票、入园顺利，预订时请务必填写真实姓名、手机号码等信息。②门票当天有效，出园需入园，需再次购买门票。活动提醒1.', '山西', '23', 'null', '[]');
INSERT INTO `Scenery` VALUES ('230329', '3339', '山西省太原市尖草坪区宇文村东，宇文河生态庄园服务保障：如实描述入园保障精彩点评：不错，孩子去玩的很开心，就是有点天热，冰场不能，玩有点遗憾，但是其他的都不错，喜欢。...', '307', '景区统一售票，暂无其他特惠政策，具体以景区公告为准。', '2018-05-0512:56:54.180', '太原以玩乐为主的滑雪场，宇文河南极岛冰雪嘉年华，拥有80000㎡巨型滑冰场。', '尖草坪区', '8:30-18:00（2月20日开始冬季游玩项目闭园）', '宇文河-南极岛冰雪嘉年华', '太原', '太原以玩乐为主的滑雪场，宇文河南极岛冰雪嘉年华，拥有80000㎡巨型滑冰场。除了拥有多种类型的滑雪道及嬉雪场地外，更有雪地悠波球、雪地热气球、雪地香蕉船等二十于种嬉雪项目、还有十余种冰上项目、130米超宽雪道等你来玩。来这里享受冰雪世界的欢乐。', 'null', '①门票当天有效，出园后再次入园，需再次购票。②为保证取票、入园顺利，预订时请务必填写真实姓名、手机号码、身份证等信息。', '山西', '23', 'null', '[]');
INSERT INTO `Scenery` VALUES ('229211', '3339', '山西省太原市尖草坪区柏板乡宇文村服务保障：如实描述入园保障精彩点评：还可以吧！总体而言一般般，人不少，东西一般。吃饭的地方还可以。...', '307', '身高1.4米（含）以下儿童购景区优惠票。', '2018-05-0512:56:54.552', '园区内以乡村风格为基调，设计精美，设施齐全，环境温馨质朴，交通便利，包含宇文河度假酒店、私家木屋庭院、60亩薰衣草观光园、40亩皇家欧式草坪婚礼基地、果蔬采摘园、创意互动游玩区、水上乐园区、英式马术体验场、垂钓区、红果树烧烤区、沙滩球类竞技区、童心动物乐园、山西手工艺术区（葫芦、陶艺、根雕等创意DIY）、石磨体验坊（豆腐、香油、面等）、农耕文化博物馆、三晋民俗文化长廊、3000米葫芦长廊及卡丁车、迷宫、真人CS、童趣金鱼以及龙城地标拓展训练基地。', '尖草坪区', '9:00-18:00', '宇文河生态庄园', '太原', '园区内以乡村风格为基调，设计精美，设施齐全，环境温馨质朴，交通便利，包含宇文河度假酒店、私家木屋庭院、60亩薰衣草观光园、40亩皇家欧式草坪婚礼基地、果蔬采摘园、创意互动游玩区、水上乐园区、英式马术体验场、垂钓区、红果树烧烤区、沙滩球类竞技区、童心动物乐园、山西手工艺术区（葫芦、陶艺、根雕等创意DIY）、石磨体验坊（豆腐、香油、面等）、农耕文化博物馆、三晋民俗文化长廊、3000米葫芦长廊及卡丁车、迷宫、真人CS、童趣金鱼以及龙城地标拓展训练基地。庄园内建有大型的农产品销售中心，能够让农户和游客面对面的进行销售，这样省去了中间商的环节，同时能让农户足不出户就能让游客购买的新鲜的农产品，可供选购的农副产品有：“宇文红薯”、宇文豆腐、豆腐干，宇文牌黄粉虫鸡蛋、宇文香瓜、老字号的“翁头青”纯粮食酒；草莓、葡萄、杏、桃、苹果、黄瓜、番茄、太空椒等无公害蔬菜；以及自产的小杂粮类产品。游客在这里可以在观赏和休闲的同时，置身于相对质朴的自然区域，尽情享受风光美景的同时感到回归自然、返璞归真，是太原市民休闲、娱乐、游玩、教育孩子的好去处。同时宇文村有深厚的隋唐历史文化内涵。', 'null', '①为保证取票、入园顺利，预订时请务必填写真实姓名、手机号码等信息。②门票当天有效，出园需入园，需再次购买门票。活动提醒1.', '山西', '23', 'null', '[]');
INSERT INTO `Scenery` VALUES ('210025', '3339', '山西省太原市尖草坪区西墕乡西高庄村服务保障：如实描述入园保障精彩点评：1、同程又快捷又便宜，不用排长队！便宜又快捷！取票便捷，不用排队，看到旁边排队长处长的，暗喜，同程真的很给力。2、不错，...', '307', '暂无其他优惠政策。', '2018-05-0512:56:56.822', 'null', '尖草坪区', '9:00-17:00（无需预约,到店请出示预订成功短信）。', '栖贤谷农业生态园草莓采摘', '太原', '', 'null', ' a.自采摘的蔬果需全部带走； b.采摘不限时、不限量； c.除特殊说明外，不可以边采边吃；活动提醒1.', '山西', '23', 'null', '[]');
INSERT INTO `Scenery` VALUES ('229156', '2092', '山西省晋城市阳城县相府庄园服务保障：如实描述入园保障周边景点推荐', '302', 'A.免票政策：儿童身高1.2米(不含)以下免票；B.优惠政策：儿童身高1.2(含)-1.5米(含)之间购景区优惠票。（上述优惠政策，需到景区自行购买）注：以上优惠政策仅供参考，具体执行以景区现场具体规定为准。', '2020-05-0622:01:23.811', '本馆按博物馆展示陈列标准布建，展品上迄新石器时期（约公元前30世纪初），下至明代（约公元前17世纪），种类涵盖石器、玉器、陶器、青铜器、瓷器等。', '阳城县', '8:00-21:00', '相府庄园春秋楼', '晋城', '本馆按博物馆展示陈列标准布建，展品上迄新石器时期（约公元前30世纪初），下至明代（约公元前17世纪），种类涵盖石器、玉器、陶器、青铜器、瓷器等。通过大量藏品的递次展出和专业人员声情并茂的讲解，旨在揭示中华文明的形成、发展以致终成文明体系的嬗变进程。使游客充分感受到不同历史时期文化艺术品所呈现出的不同艺术风格，领略到每件展品所蕴含的丰富的历史文化信息。', 'null', '①为保证取票、入园顺利，预订时请务必填写真实姓名、手机号码等信息。②门票当天有效，出园需入园，需再次购买门票。活动提醒1.2.', '山西', '23', 'null', '[{\"picUrl\":\"http://pic5.40017.cn/03/000/74/58/rBANB13JAieAcXQfAAM3b9ixYTo273.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/03/000/74/58/rBANB13JAieAcXQfAAM3b9ixYTo273_130x130_00.jpg\"},{\"picUrl\":\"http://pic5.40017.cn/03/000/74/58/rBANB13JAiaALGP1AAMzq-ojUAo201.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/03/000/74/58/rBANB13JAiaALGP1AAMzq-ojUAo201_130x130_00.jpg\"},{\"picUrl\":\"http://pic5.40017.cn/03/000/dc/42/rB5oQF3JAiaALpA-AAMTgN9Y-F4947.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/03/000/dc/42/rB5oQF3JAiaALpA-AAMTgN9Y-F4947_130x130_00.jpg\"},{\"picUrl\":\"http://pic5.40017.cn/03/000/74/58/rBANB13JAiWAPemAAANQP8Llhxo459.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/03/000/74/58/rBANB13JAiWAPemAAANQP8Llhxo459_130x130_00.jpg\"},{\"picUrl\":\"http://pic5.40017.cn/03/000/dc/42/rB5oQF3JAiWAXaI4AAGbiRjnllA718.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/03/000/dc/42/rB5oQF3JAiWAXaI4AAGbiRjnllA718_130x130_00.jpg\"},{\"picUrl\":\"http://pic5.40017.cn/03/000/74/58/rBANB13JAiSAHK0fAAMGKPDhpk8707.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/03/000/74/58/rBANB13JAiSAHK0fAAMGKPDhpk8707_130x130_00.jpg\"}]');
INSERT INTO `Scenery` VALUES ('229702', '2092', '山西省晋城市阳城县北留镇郭峪村（皇城相府景区附近）服务保障：如实描述入园保障精彩点评：郭峪古城是刚开发，里面还没商业气息，比较原生态的山西古村落，值得一去！...', '302', 'A.免票政策：儿童身高1.2米(含)以下免票；70周岁(含)以上老人、军人、残疾人、记者等凭有效证件免票。B.优惠政策：儿童身高1.2米(不含)-1.5米(含)、60周岁(含)-70周岁(不含)之间老人凭老年证或身份证购景区优惠票。（上述优惠政策，需到景区自行购买）。注：以上优惠政策仅供参考，具体执行以景区现场具体规定为准。', '2020-05-0622:01:23.971', '郭峪古城，位于AAAAA级旅游景区皇城相府南300米（皇城相府实为郭峪古城的北翼城，侍郎寨为郭峪古城的东翼城），是“中国历史文化名村”，是太行山麓一座城堡式村落。城内是独具特色的明清建筑群，为全国重点文物保护单位，被古建筑学泰斗罗哲文誉为“中华民居之瑰宝”。', '阳城县', '7:30-18:00', '郭峪古城景区', '晋城', '郭峪古城，位于AAAAA级旅游景区皇城相府南300米（皇城相府实为郭峪古城的北翼城，侍郎寨为郭峪古城的东翼城），是“中国历史文化名村”，是太行山麓一座城堡式村落。城内是独具特色的明清建筑群，为全国重点文物保护单位，被古建筑学泰斗罗哲文誉为“中华民居之瑰宝”。千百年古城堡传统古村落——郭峪村，是座唐初建置，规模宏大，布局合理，极具特色的城堡式传统古村落，是晋商云集，辐射四周物资集散地。郭峪古城修建于明崇祯八年（1635年），防御功能非常完善，用砖石修砌了629.5眼窑洞，可屯兵储物，城均高12米，城周长1400余米，城堞垛口450个，城堡13座，城内总面积18万平方米，城开三个门，分别东为景阳门、西为永安门、北为拱辰门，为便于排洪分别修了西低水门、东低水门，城内西南角建有在阳城境内保存为完好且面积的一座汤帝庙。“沁河流百里，灵气钟古城”郭峪古城、雄伟博大，城墙依山而建傍水而立，城头雉堞林立，城中豫楼高耸，古庙森严，官宅豪华，民居典雅，早在2001年8月由晋城市文化局邀请国家和省部分专家学者在北留镇召开了郭峪古城保护暨旅游开发可行性研究报告，提出具体保护修缮意见。', 'null', '①为保证取票、入园顺利，预订时请务必填写真实姓名、手机号码等信息。②门票当天有效，出园需入园，需再次购买门票。', '山西', '23', 'null', '[{\"picUrl\":\"http://pic4.40017.cn/scenery/destination/2016/12/12/17/on3z9z.jpg\",\"picUrlSmall\":\"http://pic4.40017.cn/scenery/destination/2016/12/12/17/on3z9z_130x130_00.jpg\"},{\"picUrl\":\"http://pic4.40017.cn/scenery/destination/2016/12/12/17/HsA9Q6.jpg\",\"picUrlSmall\":\"http://pic4.40017.cn/scenery/destination/2016/12/12/17/HsA9Q6_130x130_00.jpg\"},{\"picUrl\":\"http://pic4.40017.cn/scenery/destination/2016/12/12/17/efmK4a.jpg\",\"picUrlSmall\":\"http://pic4.40017.cn/scenery/destination/2016/12/12/17/efmK4a_130x130_00.jpg\"}]');
INSERT INTO `Scenery` VALUES ('228676', '2089', '山西省晋城市城区北石店镇东上村东南侧200米（景熙农业园内）服务保障：如实描述入园保障精彩点评：不错，大人，宝宝都可以玩...', '302', 'A.优惠政策：儿童身高1.4米以下（不含）购景区优惠票。注：以上优惠政策仅供参考，具体执行以景区现场具体规定为准。', '2018-05-0512:57:00.766', '晋城城市海景水上乐园是山西省仅有的大型人造海滨浴场，坐落在山西省晋城市城区北石店镇东上村东南侧200米（景熙农业园内）。', '晋城市区', '9:00—18:00', '晋城城市海景水上乐园', '晋城', '晋城城市海景水上乐园是山西省仅有的大型人造海滨浴场，坐落在山西省晋城市城区北石店镇东上村东南侧200米（景熙农业园内）。水上乐园以浓缩热带海滨风情为主题，建有大型人造海浪池、广阔的沙滩区、大型五彩滑道、水寨、风情水车、漂流河等，并有多项附属娱乐、服务设施。是晋城人夏日休闲避暑，就近享受海景的绝佳去处。', 'null', '①门票当天有效，出园需再次入园，需再次购票。②为保证取票、入园顺利，预订时请务必填写真实姓名、手机号码等信息。活动提醒1.', '山西', '23', 'null', '[]');
INSERT INTO `Scenery` VALUES ('231363', '2089', '山西省晋城市白马寺小张村直行200米服务保障：如实描述入园保障精彩点评：不错，期待以后有更多的活动...', '302', 'A.免费政策：身高1.2米（不含）以下儿童免票（须有购票成人陪同）；B.优惠政策：身高1.2米（含）-1.4米（含）的儿童购儿童票。（上述优惠政策如有变动请以景区实际要求为准）', '2018-05-0512:57:01.035', '海浪波涛汹涌，在炎炎夏日为你送去阵阵清凉，巨浪高时可达2米。激情、火热、浪花，释放生活压力。不依靠工具的人体直滑滑道。瞬间发射，给人以瞬间坠入深渊旋即又冲上云霄或潜入浪花的感觉，体验上天入地般的体感刺激。', '晋城市区', '周一至周五9:00-18:00；周六至周日8:30-21:30', '星海滩水上乐园', '晋城', '海浪波涛汹涌，在炎炎夏日为你送去阵阵清凉，巨浪高时可达2米。激情、火热、浪花，释放生活压力。不依靠工具的人体直滑滑道。瞬间发射，给人以瞬间坠入深渊旋即又冲上云霄或潜入浪花的感觉，体验上天入地般的体感刺激。超级大喇叭新奇快感，不得不玩，朋友4人坐在四叶草形状的皮筏中，从6米多高的平台缓缓出发，然后在你放松紧张的心情时，突然下坠，整个人处于失重状态，然后你会看到坐在对面的朋友在声嘶力竭大尖叫。你们的嗓音会充斥整个水上乐园。亲子戏水池，由各类奇幻、卡通、水蘑菇、喷泉为主，让你跟孩子在炎热的夏日尽情玩水，充分的给孩子自己的爱。也让您感受到孩子的童真。当你从滑道急速俯冲下去时，失重得感觉充斥全身，你除了抱紧自己的头还能怎样。声嘶力竭得尖叫吗？尽享三彩滑梯极速俯冲向地面的惊心动魄，玩这个，你需要一个强大而又坚强的内心，才能支撑你享受到风驰电掣的乐趣。注意哦！一定要睁开眼睛仔细盯着。', 'null', '①门票当天有效，出园需入园，请再次购票。②为保证取票、入园顺利，预订时请务必填写真实姓名、手机号码等信息。', '山西', '23', 'null', '[]');
INSERT INTO `Scenery` VALUES ('228432', '2096', '山西省晋中市榆次东外环山庄头村服务保障：如实描述入园保障周边景点推荐', '303', '免票政策：儿童身高1.4米（含）以下免票；老年人凭老年证免票。', '2018-05-0512:57:04.482', 'null', '晋中市区', '9:00-18:00', '小五台庄园', '晋中', '', 'null', '①为保证取票、入园顺利，预订时请务必填写真实姓名、手机号码等信息；②门票当天有效，出园需入园，需再次购买门票。', '山西', '23', 'null', '[]');
INSERT INTO `Scenery` VALUES ('231496', '2169', '山西省运城永济市水峪村神潭大峡谷景区内', '310', '免票政策：儿童身高1.2米(含)以下免票。注：以上特惠政策仅供参考，具体说明以景区当天公告为准。', '2020-03-1911:09:14.549', '告别低俗老司机，营养健康的歌舞表演和红艺人才是绝配。泰国正宗红艺人空降现场，为您打造老少皆宜，雅俗共赏的综艺娱乐文艺盛宴。', '永济市', '演出时间：13:10、14:20、15:30', '红艺人演绎中心', '运城', '告别低俗老司机，营养健康的歌舞表演和红艺人才是绝配。泰国正宗红艺人空降现场，为您打造老少皆宜，雅俗共赏的综艺娱乐文艺盛宴。更有泰国皇后桃子，公主Tina，歌舞红星coco，舞蹈主秀飘飘，泰蜜儿，卡琳娜，新颜，金儿倾情加盟。想看极具特色的大型歌舞类文艺演出？就来红艺人演艺中心，我们等着您！人妖的生命和艺术生涯都是非常短暂的，他们的生理周期大致有两个阶段:一是成长期(18岁以前)，这个阶段是人妖向女性化方向成长的重要阶段，同时，他们要接受相关的艺术培训；二是鼎盛期(18-25岁)，这是人妖的事业巅峰期，这个年龄段的红艺人会获得很多的登台表演机会，拥有美好的一面。', '62', '①门票当天有效，出园需入园，请再次购票。②为保证取票、入园顺利，预订时请务必填写真实姓名、手机号码等信息。③座位随机安排，无法自行选择，感谢您的配合！', '山西', '23', '{\"lon\":\"34.83952251\",\"lat\":\"110.4377605\"}', '[]');
INSERT INTO `Scenery` VALUES ('231194', '2169', '山西省永济清华南王官峪村中条山服务保障：如实描述入园保障精彩点评：景区很飘亮水很多，就是有点小。...', '310', '景区统一售票，暂无其他特惠政策，具体以景区公告为准。', '2020-05-0622:01:31.832', '王官谷位于永济市以东40余里的中条山麓，景区面积10平方公里。谷内有天柱峰、东西瀑布、贻溪清流、奇峰珠帘、明镜映天、百二盘山、休休亭、三诏堂等自然胜景和古建遗存。', '永济市', '8:00-18:00', '永济王官谷', '运城', '王官谷位于永济市以东40余里的中条山麓，景区面积10平方公里。谷内有天柱峰、东西瀑布、贻溪清流、奇峰珠帘、明镜映天、百二盘山、休休亭、三诏堂等自然胜景和古建遗存。官景区是一处品位绝佳的避暑胜地。清代诗人魏源赞王官谷：“晴空雨雪三千丈，终古风云十二时”。王官谷是唐末著名的大诗人、诗歌文学理论家司空图晚年隐居之地，曾在此写下《休休记》、《一鸣集》等30卷文集传世，特别是他写的《诗品二十四则》是我国乃至世界文学史上一部杰出的诗歌文学理论经典。王官峪谷幽壑深，飞瀑流泉，林荫层次，奇峰异石。分东，西两涧瀑布：东瀑布称水珠垂帘，落差48.64米，崖石绿苔覆盖，水从石出，落地珍珠。西瀑布称石崖喷雪，落差220米。主峰天柱峰，顶天立地，双鹤峰，高耸如云，百二盘，峰回路转，黄沙洞，神秘莫测。天柱峰是王官谷内的一座独立擎天，巍然高耸的奇峰。它挺拔雄峻，怪石鳞峋，苍松古柏高挂于悬崖峭壁之间。远远望去，峻岩林立，巍峨壮观。在天柱峰两侧有东西两道瀑布，相距半里许。冬天似冰柱倒挂，涓涓一线细流；夏日则飞湍直下，犹如垂天白练。水激石峭，白雾腾空。注目细看，瞬息万状。暑月，数十步外，冷气袭人，驻足小憩，顿觉凉爽舒适，心旷神怡。两瀑之水在峰前合二为一，形成一条湍急的溪流，沿谷而下，被司空图命名为“贻溪”。在天柱峰脚下，原有一座砖木结构的亭子，掩映在松柏之中。因年久失修，现在仅存颓垣残壁。据说这亭子是司空图隐居时所建，初名“濯缨亭”，后改“休休亭”。在休休亭之下约百米之处，有“三诏堂”。现在只存遗址，灌木丛生，一片苍翠。', 'null', '①为保证取票、入园顺利，预订时请务必填写真实姓名、手机号码等信息；②门票当天有效，出园需入园，请再次购票。', '山西', '23', 'null', '[{\"picUrl\":\"http://pic5.40017.cn/01/001/a5/39/rBLkBVkAN5GAWTsLAAIAAO9bydg377.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/01/001/a5/39/rBLkBVkAN5GAWTsLAAIAAO9bydg377_130x130_00.jpg\"},{\"picUrl\":\"http://pic5.40017.cn/01/000/a5/39/rBLkBlkAN5SAVhl3AAIAAKzKtxY272.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/01/000/a5/39/rBLkBlkAN5SAVhl3AAIAAKzKtxY272_130x130_00.jpg\"},{\"picUrl\":\"http://pic5.40017.cn/02/000/a5/12/rBLkCVkAN5SABUIfAAQAAJeToAk094.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/02/000/a5/12/rBLkCVkAN5SABUIfAAQAAJeToAk094_130x130_00.jpg\"},{\"picUrl\":\"http://pic5.40017.cn/02/000/a5/12/rBANDFkAN5OAd-sVAAIAAHJ09kQ200.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/02/000/a5/12/rBANDFkAN5OAd-sVAAIAAHJ09kQ200_130x130_00.jpg\"},{\"picUrl\":\"http://pic5.40017.cn/01/001/a5/39/rBLkBVkAN5KAWU8iAAIAAFDNASY147.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/01/001/a5/39/rBLkBVkAN5KAWU8iAAIAAFDNASY147_130x130_00.jpg\"},{\"picUrl\":\"http://pic5.40017.cn/01/001/a5/39/rBLkBlkAN5KAJPxFAAIAAFiBUkg062.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/01/001/a5/39/rBLkBlkAN5KAJPxFAAIAAFiBUkg062_130x130_00.jpg\"},{\"picUrl\":\"http://pic5.40017.cn/02/001/a5/12/rBLkCFkAN5GACnaBAAIAAGGjN0w421.jpg\",\"picUrlSmall\":\"http://pic5.40017.cn/02/001/a5/12/rBLkCFkAN5GACnaBAAIAAGGjN0w421_130x130_00.jpg\"}]');
